import React , { Component } from 'react';
import About from '../About/About';
import Contact from '../Contact/Contact';
import InteriorDesign from '../InteriorDesign/InteriorDesign';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';


class Navigation extends Component {
    constructor(props) {
        super(props);
        
        this.state = {
            toggleCateg: false                  
        }
    }


    test(){
        const {toggleCateg } = this.state;

        this.setState({
            toggleCateg: !toggleCateg
        })
    }
    
    render () {
        return (
            <div>
                <Navbar collapseOnSelect expand="lg"  variant="dark">
                    <Navbar.Brand href="#home">React-Bootstrap</Navbar.Brand>
                    <Navbar.Toggle aria-controls="responsive-navbar-nav" />
                    
                    <Navbar.Collapse id="responsive-navbar-nav">
                        <Nav className="mr-auto">
                            <Nav.Link className="lol" id="asd" href="#features">Features</Nav.Link>
                            <Nav.Link href="#pricing">Pricing</Nav.Link>
                        </Nav>

                        <Nav>
                            <Nav.Link href="#deets">More deets</Nav.Link>
                            <Nav.Link eventKey={2} onClick={this.test} href="#memes">
                                x
                            </Nav.Link>
                        </Nav>

                    </Navbar.Collapse>
                    </Navbar>
            </div>
        )
    }
}


export default Navigation;
